import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 48, height: 48, viewBox: "0 0 48 48", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M24 6a11 11 0 00-10.96 10h-.29a7.75 7.75 0 000 15.5h7.34a13 13 0 0122.86-6.87 7.75 7.75 0 00-7.7-8.63h-.3A11 11 0 0024 6zm20 27a11 11 0 11-22 0 11 11 0 0122 0zm-5.3-4.3a1 1 0 00-1.4-1.4L33 31.58l-4.3-4.3a1 1 0 00-1.4 1.42L31.58 33l-4.3 4.3a1 1 0 001.42 1.4L33 34.42l4.3 4.3a1 1 0 001.4-1.42L34.42 33l4.3-4.3z", fill: primaryFill }));
};
const CloudDismiss48Filled = wrapIcon(rawSvg({}), 'CloudDismiss48Filled');
export default CloudDismiss48Filled;
